custom_css.post_content:
.navbar-brand {
    display: inline-block;
    padding-top: .3125rem;
    padding-bottom: .3125rem;
    margin-right: 0;
    font-size: 1.25rem;
    line-height: inherit;
    white-space: nowrap;
}
.owl-prev {
    position: absolute;
    left: 5%;
    font-size: 20px;
    top: 50%;
	transform:translatey(-50%);
}
.owl-next{
	position: absolute;
    right: 5%;
    font-size: 20px;
    top: 50%;
	transform:translatey(-50%);
}

.h1, h1 {
    font-size: 1.7rem;
	font-family: 'Cinzel Decorative', cursive;
}

@media screen 
  and (min-device-width: 1200px) 
  and (max-device-width: 1600px) 
  and (-webkit-min-device-pixel-ratio: 2)
  and (min-resolution: 192dpi) { 
		.read {
    text-align: center;
    padding: 20px;
}
}

@media screen
and (min-device-width: 1200px)
and (max-device-width: 1600px)
and (-webkit-min-device-pixel-ratio: 2)
and (min-resolution: 192dpi) {
    .read {
        text-align: center;
        padding: 20px;
    }
    #faq .faq-box {
        padding: 20px 40px 80px 40px;
    }
    .section-header {
        margin-bottom: 40px;
        margin-top: 40px;
    }
	.contact-info {
    font-size: 15px;
}

#masthead-header .top-header .contact-info {
    display: -webkit-flex;
    display: -moz-flex;
    display: -ms-flex;
    display: -o-flex;
    display: flex;
    -ms-align-items: center;
    align-items: center;
    height: 100%;
    line-height: 40px;
}
}
